import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const Cart = () => {
  return (
    <CartDiv>
      <LinkStyled to="/cart">
        <img src="./static/cart.png" alt="cart" width="50px" height="50px" />
      </LinkStyled>
    </CartDiv>
  );
};

const CartDiv = styled.div`
  position: absolute;
  margin-left: 765px;
`;

const LinkStyled = styled(Link)`
  padding: 0 10px 0 10px;
`;

export default Cart;
